  cache: new InMemoryCache(),

});
function App() {
  return <ApolloProvider client = {client}>
    <div className="createUser">
      <input type="text" placeholder="Name"/><br/>
      <input type="text"  placeholder="Name" /><br/>
      <input type="text"/><br/>
      <button>Create User</button><br/>
    </div>
    </ApolloProvider>;
}

